    true,nt"url": null,nt"notes": "<p>TXT4Tots is a library of short, evidence-based
    messages focused on nutrition and physical activity. The library is targeted to
    parents and caregivers of children, ages 1-5 years, and is available in English
    and Spanish. Content for the messages was derived from American Academy of Pediatrics
    (AAP) Bright Futures: Guidelines for Health Supervision of Infants, Children and
    Adolescents, which uses a developmentally based approach to address childrenu2019s
    health needs in the context of family and community. TXT4Tots End User Agreement
    found here: <a href="http://www.hrsa.gov/healthit/txt4tots/enduseragreement.html">http://www.hrsa.gov/healthit/txt4tots/enduseragreement.html</a></p>n",nt"license_title":
